import React from 'react';
import './AboutUs.css';


const AboutUs = () => {
  return (
    <div className="about-us-container">
      <h1>About Titan</h1>
      <p>Titan is a leading watch and accessories brand based in India. Founded in 1984, Titan has since become one of the most trusted and respected names in the industry, with a wide range of products designed to suit every taste and budget.</p>
      <p>At Titan, we believe in crafting products that are not only beautiful and functional, but also sustainable and ethically made. We are committed to reducing our impact on the environment and supporting local communities, and we work tirelessly to ensure that every step of our supply chain is as responsible as possible.</p>
      <h2>Our Team</h2>
      <p>Our team of designers, engineers, and craftsmen are some of the most talented and passionate in the industry. From concept to production, we take great care to ensure that every product we make is of the highest quality and designed to last a lifetime.</p>
      <p>Meet some of our team members:</p>
      <ul>
        <li>
          <h3>John Doe</h3>
          <p>Lead Designer</p>
        </li>
        <li>
          <h3>Jane Smith</h3>
          <p>Lead Engineer</p>
        </li>
        <li>
          <h3>Michael Brown</h3>
          <p>Lead Craftsman</p>
        </li>
      </ul>
    </div>
  );
};

export default AboutUs;
